import './App.css';
import Navbar from './Components/Navbar'
import Footer from './Components/Footer'
import UserJob from './Components/UserJob'
import aswinImage from './static/images/aswin.jpg'
import { useEffect, useState } from 'react';
import axios from 'axios';


function App() {

  const [jobs, setJob] = useState([])

  useEffect(() => {
    axios.get("http://192.168.18.139:8080/api/json?tree=jobs[name,description,url]",
      {
        auth: {
          username: "aswinrprasad",
          password: "11ffc06e2cc9962d0b57d41551132a8256"
        }
      })
      .then((res) => {
        console.log(res.data.jobs)
        // for(let job of res.data.jobs){
        //   setName(job.name)
        //   setDesc(job.description)
        //   setUrl(job.url)
        // }
        setJob(res.data.jobs)
      })
      .catch((err) => console.log(err))
  }, [])

  const userJobComp = jobs.map((job) =>
    <div className="col-3"><UserJob profileImage={aswinImage}
      jobname={job.name}
      jobdesc={job.desc}
      endpoint_url={job.url} />
    </div>
  )
  return (
    <div className="main">
      <Navbar />
      <div className="container">
        <div className="row">
          {userJobComp}
        </div>
      </div>
      <Footer />
    </div>
  );
}

export default App;
